- input: "TEXT\x1CC00358952\x1CX0\x1C\x1CF3A\x1CTo Whom It May Concern:    This amendment
    is in response to the letter by the commission dated January 6, 2009 regarding
    the 30 Day Post-General Report for the Steve Israel for Congress Committee (C00358952)
    and should serve to clarify the discrepancies with the report.     In reference
    to the first item concerning the apparent failure to file a 48 hour notice:    The
    contribution in question from Defending America?s Future PAC was an offset and
    coded as such in our database and on our filing. This offset was the result of
    conditions explained by the amendment filed on 10/17/08.    The Steve Israel for
    Congress Committee placed a call to the FEC Compliance Division on 10/28/08 before
    filing the 48 Hour Report in order to clarify the coding of this transaction.
    The entry was coded in this manner after receiving instructions to do by FEC compliance.
    Once the transaction was coded as an offset, it ceased to appear on the 48 Hour
    report that was filed on time by the Committee.     In addition, this amendment
    discloses two In-Kind contributions that had not appeared on the initial report
    due to a software error. One of which is from Martin Scheinman, an individual
    in the amount of $1,000. The other is from the Poker Player?s Alliance PAC in
    the amount of $18.32.    This amendment will also serve to correct the Column
    B discrepancies on the subsequent Year End Report.     The Steve Israel for Congress
    Committee remains committed to achieving complete compliance and improved reporting
    and disclosure.   "
